import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    ImageList,
    ImageListItemBar,
    ImageListItem,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";

  const itemData = [
    {
      img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
      title: 'Breakfast',
    },
    {
      img: 'https://images.unsplash.com/photo-1551782450-a2132b4ba21d',
      title: 'Burger',
    },
    {
      img: 'https://images.unsplash.com/photo-1522770179533-24471fcdba45',
      title: 'Camera',
    }, {
      img: 'https://images.unsplash.com/photo-1597645587822-e99fa5d45d25',
      title: 'Mushrooms',
    },
    {
      img: 'https://images.unsplash.com/photo-1567306301408-9b74779a11af',
      title: 'Tomato basil',
    },
    {
      img: 'https://images.unsplash.com/photo-1471357674240-e1a485acb3e1',
      title: 'Sea star',
    }];
  function Projects() {
    return (
      <Container
      fixed
      sx={{
        bgcolor: "#1f1f2f",
        boxShadow: "0rem 0.0rem 5em rgba(0, 0, 0, 1)",
      }}
    >
      <Box sx={{ pt: "10px" }}>
      <h1>Maze Game</h1>
      <Box sx={{ mb: "10px", borderBottom: "2px solid white" }}>
        <Stack spacing={0} direction="row" sx={{ overflowX: "auto" }}>
          <ImageList
                  sx={{
                    width: "100vw", // Set a fixed width to determine the visible images
                    display: "flex",
                    flexDirection: "row",
                  }}
                  rowHeight={400}
                >
                  {itemData.slice(0, 10).map((item) => (
                    <ImageListItem
                      key={item.img}
                      sx={{
                        flex: "0 0 auto", // Allow the item to shrink but not grow
                        maxWidth: "25%", // Set the maximum width of each item
                        overflowY: "hidden",
                        margin: "0", // Add some spacing between items
                        height: "100vh",
                        "&:hover": {
                          border: "1px solid indigo",
                        },
                      }}
                    >
                      <img
                        src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
                        srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                        alt={item.title}
                        loading="lazy"
                      />
              </ImageListItem>
                ))}
            </ImageList>
        </Stack>
      </Box>
      </Box>
    </Container>
    );
  };

  export default Projects;
